#include <gtest/gtest.h>

#include "../../LeetCode_Solutions/May_2021/WordFilter.h"

struct WordFilterTestResult
{
	vector<string> words;
	string prefix;
	string suffix;
	int result;

};

ostream& operator<<(ostream& stream, WordFilterTestResult& rhs)
{
	stream << "WORD: {";
	for (auto& word : rhs.words)
	{
		stream << "\"" << word << "\",";
	}
	stream << "}" << std::endl 
		<< "prefix: " << rhs.prefix << std::endl
		<< "postfix:" << rhs.suffix << std::endl
		<< "expected result: " << rhs.result << std::endl;
	return stream;
}

struct WordFilterTest : testing::TestWithParam<WordFilterTestResult>
{
	WordFilterTest() : filter_{ std::move(GetParam().words) }
	{
	}

	WordFilter filter_;
};

TEST_P(WordFilterTest, all_cases) {
	auto params = GetParam();
	int res = filter_.f(params.prefix, params.suffix);
	cout << params;
	ASSERT_EQ(res, params.result);
}

